import React, { useState } from 'react'
import { TextField, Typography } from '@mui/material'
const TextFill = () => {
    const {name,setName} = useState('')
  return (
    <div>
        <TextField value={name} onClick={(e)=>setName(e.target.value)} type={'text'} placeholder='name' sx={{margin:3}} variant='outlined'/>
        <TextField type={"email"} placeholder='email' sx={{margin:3}}  variant='standard'/>
        <TextField type={"passowrd"}placeholder='password' sx={{margin:3}}  variant='filled'/>
        <Typography>{name}</Typography>
    </div>
  )
}

export default TextFill
